window.bookSummaryJSON = "<p><b>In the modern world, qi is money.</b></p> <p>The days of traveling martial artists and mountaintop masters are over. Power is controlled by corporations, modernized martial arts sects, and governments. Those at the bottom of society struggle as second class citizens in a world in which power is a commodity.&nbsp;</p> <p>Rick may have survived the multitier tournament, but that doesn't mean his life will be easy. He finds the search for a better job is filled with traps and pitfalls, his sister is coming to terms with her dark power, and vendettas old and new plague them. This time, his journey will take him from the city to the wilderness....</p>"; 
